import "./App.css"
import { Provider } from "react-redux"
import configStore from "./store/store"
import Tweet from "./components/Tweet"
import { addTweet } from "./action/tweet"

const store = configStore()

addTweet({
    id: 1,
    name: "Test",
    comments: 12,
    retweets: 23,
    likses: 23,
})

function App() {
    return (
        <Provider store={store}>
            <div className="App">
                <Tweet />
            </div>
        </Provider>
    )
}

export default App
